{
  "bracketSpacing": false,
  "singleQuote": true
}

module.exports = function(config) {
  require('./karma.conf.js')(config);
  config.set({
    webpack: {
      module: {
        rules: config.webpack.module.rules.slice(1).concat([
          {
            test: /\.js$/,
            exclude: [/node_modules/],
            use: {
              loader: 'babel-loader',
              options: {
                plugins: ['istanbul']
              }
            }
          }
        ])
      }
    },
    reporters: config.reporters.concat(['coverage']),
    plugins: config.plugins.concat(['karma-coverage']),
    coverageReporter: {
      reporters: [
        {
          type: 'text'
        },
        {
          type: 'lcovonly',
          subdir: '.'
        }
      ]
    }
  });
};

module.exports = function(config) {
  require('./karma.conf.js')(config);
  config.set({
    plugins: config.plugins.concat('karma-ie-launcher'),
    browsers: ['IE9'],
    customLaunchers: {
      IE9: {
        base: 'IE',
        'x-ua-compatible': 'IE=EmulateIE9'
      }
    }
  });
};

const path = require('path');

process.env.BABEL_ENV = 'commonjs';

module.exports = function(config) {
  config.set({
    basePath: '',
    frameworks: ['mocha', 'sinon-chai'],
    files: [
      // Polyfills for IE9 in React 16.
      require.resolve('core-js/es6/map'),
      require.resolve('core-js/es6/set'),
      'src/__tests__/**/*.js'
    ],
    preprocessors: {
      [path.join(
        path.dirname(require.resolve('core-js/package.json')),
        'es6/**/*.js' // eslint-disable-line prettier/prettier
      )]: ['webpack'],
      'src/__tests__/**/*.js': ['webpack']
    },
    webpack: {
      cache: true,
      module: {
        rules: [
          {
            test: /\.js$/,
            enforce: 'pre',
            include: path.resolve('src/'),
            loader: 'babel-loader'
          },
          {
            test: /\.css$/,
            loader: 'style-loader!css-loader'
          }
        ]
      },
      resolve: {
        modules: [
          path.join(__dirname, 'node_modules'),
          path.join(__dirname, 'src')
        ],
        extensions: ['.js']
      }
    },
    webpackServer: {
      quiet: false,
      noInfo: true,
      stats: {
        assets: false,
        colors: true,
        version: false,
        hash: false,
        timings: false,
        chunks: false,
        chunkModules: false
      }
    },
    exclude: [],
    port: 8080,
    logLevel: config.LOG_INFO,
    colors: true,
    autoWatch: false,
    // Run a customized instance of headless chrome for dev + Travis CI.
    browsers: ['ChromeHeadlessCustom'],
    customLaunchers: {
      ChromeHeadlessCustom: {
        base: 'ChromeHeadless',
        // --no-sandbox for https://github.com/travis-ci/docs-travis-ci-com/pull/1671/files
        flags: ['--no-sandbox']
      }
    },
    reporters: ['mocha'],
    browserNoActivityTimeout: 60000,
    plugins: [
      'karma-chrome-launcher',
      'karma-mocha',
      'karma-mocha-reporter',
      'karma-sinon-chai',
      'karma-webpack'
    ],
    browserConsoleLogOptions: {
      level: 'log',
      format: '%b %T: %m',
      terminal: true
    },
    captureTimeout: 100000,
    singleRun: true
  });
};

const path = require('path');

module.exports = {
  cache: true,
  entry: path.join(__dirname, 'src/index.js'),
  externals: [
    {
      react: {
        root: 'React',
        commonjs2: 'react',
        commonjs: 'react',
        amd: 'react'
      }
    }
  ],
  output: {
    path: path.join(__dirname, 'dist'),
    filename: 'radium.js',
    library: 'Radium',
    libraryTarget: 'umd',
    libraryExport: 'default'
  },
  module: {
    rules: [
      {
        test: /\.js$/,
        include: [path.join(__dirname, 'src')],
        loader: 'babel-loader'
      }
    ]
  }
};

const webpack = require('webpack');
const base = require('./webpack.config');

module.exports = Object.assign({}, base, {
  output: Object.assign({}, base.output, {
    filename: 'radium.min.js'
  }),
  plugins: [].concat(base.plugins || [], [
    new webpack.optimize.UglifyJsPlugin({
      compress: {
        warnings: false
      }
    }),
    new webpack.DefinePlugin({
      'process.env': {
        // Signal production mode for React JS and other libs.
        NODE_ENV: JSON.stringify('production')
      }
    })
  ])
});
